import React,{useContext} from 'react'
import { Autocomplete } from '../Autocomplete/Autocomplete'
import getPokemonNames from '../../services/PokemonDataService.jsx'
import PokemonContext from '../Contexts/PokemonContext.jsx'


export const SearchPokemon = () => {

    const { updatePokemon } = useContext(PokemonContext)

    const data = ['ola', 'lindo', 'gatao', 'bunituu', 'vem me amar']

    // await getPokemonNames()?.map(o => Capitalize(o))

    return (
        <Autocomplete data={data} icon={'pokeball'} LoadData={updatePokemon} placeholder={'Search Pokémon'} />
    )


}
